import React from 'react';

import {
  Text,
  View,
  StyleSheet,
  Image,
  ScrollView,
  TextInput,
} from 'react-native';

const Estilos = StyleSheet.create({
  container: {
    flex: 1,

    justifyContent: 'center',

    alignItems: 'center',
  },
});

const App = () => {
  return (
    <ScrollView>
      <Text>Sistema Solar</Text>
    </ScrollView>
  );
};

export default App;
